import React from 'react';

class Settings extends React.Component {
  render() {
    return (
      <div>
        <h1 data-testid="settings-title">Configurações</h1>
        <form>
          <label>
            Difficulty
            <select>
              <option>Easy</option>
              <option>Medium</option>
              <option>Hard</option>
            </select>
          </label>
        </form>
      </div>
    );
  }
}


export default Settings;
